import styled from "styled-components";
import { Colors } from "../constants/colors";

const StyledLogo = styled.h1`
  font-family: "Fredoka One", cursive;
  color: ${Colors.BLACK};
  font-size: 2rem;
  /* letter-spacing: 7px; */

  span {
    color: lightgrey;
  }
`;

export const Logo: React.FC = () => (
  <StyledLogo>
    QUIZ<span>MACHINE</span>
  </StyledLogo>
);
